    false,nt"url": null,nt"notes": "NOAA Contract: EA133C11CQ0009 NOAA Task
    Order Number: T0013 The PSFY12 GADNR Elevation Data Task Order involves: collecting
    and delivering topographic elevation point data derived from multiple return light
    detection and ranging (LiDAR) measurements for portions of 3 counties in Georgia.
    The Statement of Work (SOW) was developed by the National Oceanic and Atmospheric
    Administration's (NOAA) Coastal Services Center (referred to as the Center) in partnership
    with the Georgia Department of Natural Resources (GADNR) Environmental Protection
    Division (EPD). The counties included Pickens, Rockdale and Troup. The purpose of
    the data is for use in coastal management decision making, including applications
    such as flood plain mapping and water rights management. LiDAR was collected at
    1.0 points per square meter (1.0m GSD) for the portions of Pickens, Rockdale and
    Troup Counties. This area was flown during snow free and leaf-off conditions.",nt"owner_org":
